E_D("replace into `qb_reply` values('664','','0','683','48','1','1','<p>&nbsp;&nbsp;&nbsp;&nbsp;卡博圆环滚子轴承是一种全新类型的径向滚子轴承。这一种结构紧凑的自动调心滚子轴承是由ZWA开发的。其独特的设计结合了球面滚子轴承的自动调心能力和圆柱形滚子轴承的轴向位移特性。它还拥有滚针轴承的紧凑截面。<br />卡博轴承用于承受径向负荷的工况。这类轴承的设计专门用作浮动端轴承，结合其自动调心和轴向位移的特性，是一种节省空间、重量和生产成本的理想轴承。设计中有意将内外圈能相互之间进行轴向位移，可以精确地设定径向内部游隙。<br />卡博轴承允许更小更轻轴承配置，而提供相同，甚至是更好的性能，如行星齿轮箱。它简化了易受高温变化影响的长轴杆轴承配置。实践更证明，使用卡博轴承能降低振动，如造纸机或鼓风机的应用中。<br />卡博轴承是一种单列轴承，带有长而稍具弧面的对称滚子。内外圈的滚道为凹弧面，对称于轴承中心。优化的滚道与滚子轮廓面的配合，使轴承负荷能均匀地分布，并降低了运行时的摩擦。<br />卡博轴承的滚子能自动导位，无论内圈是否相对于外圈有否轴向位移和/或不对中的情况，它都能处于一个使负荷平均作用在整个滚子的位置上。<br />卡博轴承的承载能力很高一即使在有角度误差或轴向位移的情况下。因此这种轴承能可靠地运行且工作寿命长。<br /></p><table style=\"width:513px;border-collapse:collapse\" width=\"513\" height=\"608\"><colgroup><col width=\"84\" /><col width=\"38\" /><col width=\"42\" /><col width=\"36\" /><col width=\"25\" /><col width=\"47\" /><col width=\"50\" /><col width=\"70\" /><col width=\"121\" /><tbody><tr height=\"19\"><td style=\"text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:84px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"19\" width=\"84\">型号</td><td style=\"text-align:center;font-style:normal;width:38px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et3\" height=\"19\" width=\"38\">型号</td><td style=\"text-align:center;border-left:#c0c0c0 2px solid;font-style:normal;width:145px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;border-right:#c0c0c0 2px solid\" class=\"et2\" height=\"19\" width=\"145\" colspan=\"4\">外形尺寸(mm)</td><td style=\"text-align:center;font-style:normal;width:100px;background:#ffffff;height:19px;color:#000000;font-size:13px;vertical-align:middle;border-top:#c0c0c0 2px solid;font-weight:700;borde